settings\u0004Overrides default widget p:
애플리케이션 레이아웃에서 기본 위젯 위치를 재정의합니다.
예를 들어 오른쪽 사이드바에는 여러 문서 모드에서 터미널을 배치하고 아래쪽에는 단일 문서 모드에서 터미널을 배치합니다.
{
  "single": { "Terminal": { "area": "down" } },
  "multiple": { "Terminal": { "area": "right" } }
}.

settings\u0004Language-server specific c:
구현에 따른 언어 서버별 구성. 예:

pyls: {
  serverSettings: {
    pyls: {
      plugins: {
        pydocstyle: {
          enabled: true
        },
        pyflakes: {
          enabled: false
        },
        flake8: {
          enabled: true
        }
      }
    }
  }
}

Alternatively, using VSCode's naming convention:

pyls: {
  serverSettings: {
    "pyls.plugins.pydocstyle.enabled": true,
    "pyls.plugins.pyflakes.enabled": false,
    "pyls.plugins.flake8.enabled": true
  }
}

